import React, { Component } from 'react';
import FormUser from './../Components/FormUser';
class UserPage extends Component {
    render() {
        return (

      <div className="container">
        <div className="page-header">
          <h1>Project 05 - Bug Reporting <small>React Redux Router Firebase</small></h1></div>
        <div className="row">
          <div className="col-xs-2 col-sm-2 col-md-2 col-lg-2">
            <div className="list-group"><a className="list-group-item " aria-current="false" href="/task">Task</a><a className="list-group-item active active" aria-current="true" href="/user">User</a></div>
          </div>
          <div className="col-xs-10 col-sm-10 col-md-10 col-lg-10">
            <div className="panel panel-info">
              <div className="panel-heading">
                <h3 className="panel-title">User</h3></div>
              <div className="panel-body">
               <FormUser/>
              </div>
            </div>
          </div>
        </div>
      </div>
        );
    }
}

export default UserPage;
